import React from "react";
import MoviesData from "./MoviesData";
import "./Movies.css";

const Movies = () => {
  return (
    <>
      <div className="header">Movies Gallary</div>
      <div className="moviescards">
        {MoviesData.map((data)=>{

            return(<>
            {data.name}
            </>)
        })}
      </div>
    </>
  );
};

export default Movies;
